import React from 'react'

const persona = { 
    nombre: 'Christopher', 
    edad: 22, 
    direccion: { 
        pais: 'Mexico', 
        estado: 'Nayarit', 
        ciudad: 'Tepic', 
        direccion: 'Conocido No. 888' 
    }
}

export const ObjetosLiterales = () => {
  return (
    <div>
        <h3>Objetos Literales</h3>
        <code>
            <pre>
                {JSON.stringify(persona, null, 2)}
            </pre>
        </code>
    </div>
  )
}
